	mcall.Add("OnHUDPaint", vars["hookname"], function()
		vars["renderpanic"] = false
	
		if canRender() then
			draw.NoTexture()
			surface.SetFont("BudgetLabel")
			
			if vars["tdetector"] then
				drawTraitorDetector()
			end
			
			if vars["specdetector"] then
				drawSpectators()
			end

			if vars["hitboxonhit"] then
				local color = strColor(vars["hitbox_color"])
				local ovrcolor = strColor(vars["hitbox_color_ovr"])

				for _, g in ipairs(hits) do
					if not g or shouldPanic() then
						continue
					end
					
					if type(g) == "table" then
						for _, v in ipairs(g) do
							if not v or shouldPanic() then
								continue
							end
			
							cam.Start3D()
								if v.ovr then
									render.DrawWireframeBox(v.pos, v.ang, v.mins, v.maxs, ovrcolor)
								else
									render.DrawWireframeBox(v.pos, v.ang, v.mins, v.maxs, color)
								end
							cam.End3D()
						end
					end
				end
			end

			if vars["tracers_other"] or vars["tracers_local"] then
				for _, v in ipairs(bullets) do
					if not v or shouldPanic() then
						continue
					end
			
					cam.Start3D()
						if vars["beamtracers"] then
							render.SetMaterial(beammat)
							render.DrawBeam(v.src, v.endpos, 8, 1, 1, Color(255, 255, 255, 255))
						else
							render.DrawLine(v.src, v.endpos, v.col, true)
						end
					cam.End3D()
				end
			end
		
			if vars["followbot"] then
				local tply = vars["followtarg"]
			
				if tply ~= LocalPlayer() and IsValid(tply) then
					local text = "Following: " .. meta_pl.GetName(tply)
					
					local tw, th = surface.GetTextSize(text)
					
					surface.SetTextColor(255, 255, 255, 255)
					surface.SetTextPos((ScrW() / 2) - (tw / 2), 15)
					surface.DrawText(text)
				end
			end
			
			if mvar then
				if vars["snaplines"] then
					local fov = mvar.GetVarInt("Aimbot.Target.FoV")
					
					local retardednumber = 2.6
					local rad = (math.tan(math.rad(fov)) / math.tan(math.rad(vars["afov"] / 2)) * ScrW()) / retardednumber
					
					local method = mvar.GetVarInt("Aimbot.Target.Priority")
					
					local hw, hh = ScrW() / 2, ScrH() / 2
					local snaptarg = nil
					
					if method == 0 then
						snaptarg = getClosest(true)
					elseif method ~= 3 then
						local bhp
						local beste
						
						if method == 1 then
							bhp = math.huge
						else
							bhp = -1337
						end
					
						for _, v in ipairs(player.GetAll()) do
							if v == LocalPlayer() or not vEnt(v) then
								continue
							end
							
							if fov > 0 and fov < 180 then
								local obbpos = meta_vc.ToScreen(meta_en.LocalToWorld(v, meta_en.OBBCenter(v)))
								local dist = math.abs(math.Dist(obbpos.x, obbpos.y, hw, hh))
								
								if dist > math.ceil(rad) and fov > 0 and fov < 180 then
									continue
								end
							end
							
							local hp = meta_en.Health(v)
							
							if method == 1 then
								if hp < bhp then
									bhp = hp
									beste = v
								end
							else
								if hp > bhp then
									bhp = hp
									beste = v
								end
							end
						end
						
						if vEnt(beste) then
							snaptarg = beste
						end
					else
						local closest
						local bpos = math.huge
						
						for _, v in ipairs(player.GetAll()) do
							if v == LocalPlayer() or not vEnt(v) then
								continue
							end
							
							local obbpos = meta_vc.ToScreen(meta_en.LocalToWorld(v, meta_en.OBBCenter(v)))
							local dist = math.abs(math.Dist(obbpos.x, obbpos.y, hw, hh))
							
							if dist > math.ceil(rad) and fov > 0 and fov < 180 then
								continue
							end
							
							if dist < bpos then
								bpos = dist
								closest = v
							end
						end
						
						if vEnt(closest) then
							snaptarg = closest
						end
					end
					
					if vEnt(snaptarg) then
						local obbpos = meta_vc.ToScreen(meta_en.LocalToWorld(snaptarg, meta_en.OBBCenter(snaptarg)))
						local color = strColor(vars["snaplines_color"])
					
						surface.SetDrawColor(color)
						surface.DrawLine(hw, hh, obbpos.x, obbpos.y)
					end
				end
				
				if vars["catpng"] and not meta_im.IsError(catpng) then
					local fov = mvar.GetVarInt("Aimbot.Target.FoV")
				
					if fov > 0 and fov <= 60 then
						local retardednumber = 2.6
						local rad = (math.tan(math.rad(fov)) / math.tan(math.rad(vars["afov"] / 2)) * ScrW()) / retardednumber
						local size = rad * 1.955
						
						local color = strColor(vars["catpng_color"])
						
						surface.SetDrawColor(color)
						surface.SetMaterial(catpng)
						
						surface.DrawTexturedRect((ScrW() / 2) - (size / 2), (ScrH() / 2) - (size / 2), size + retardednumber, size + retardednumber)
					end
				end
			end
		end
	end)
end


