hook.Add("CalcView", vars["hookname"], function(ply, pos, ang, fov, zn, zf)
	if not meta_en.IsValid(ply) then
		return
	end

	local v = meta_pl.GetVehicle(ply)
	local w = meta_pl.GetActiveWeapon(ply)

	local nfov
	local force = vars["fov_force"]
	
	if force then
		nfov = vars["cfov"]
	else
		nfov = fov + (vars["cfov"] - meta_cv.GetInt(GetConVar("fov_desired")))
	end
	
	nfov = math.Clamp(nfov, 2, 179)
	
	vars["afov"] = nfov

	if vars["thirdpersonfix"] then
		if meta_pl.ShouldDrawLocalPlayer(ply) then
			local tr = util.TraceLine({
				start = pos,
				endpos = pos - (meta_an.Forward(ang) * 150),
				mask = MASK_SHOT,
				filter = LocalPlayer(),
				ignoreworld = false,
				mins = Vector(-8, -8, -8),
				maxs = Vector(8, 8, 8)
			})
		
			pos = tr.HitPos + tr.HitNormal
		end
	end

	local nview = {
		origin = pos,
		angles = ang,
		fov = nfov,
		zneaf = zn,
		zfar = zf
	}

	if meta_en.IsValid(v) then
		return hook.Run("CalcVehicleView", v, ply, nview)
	end

	if meta_en.IsValid(w) then
		local wCV = w.CalcView

		if wCV then
			local wFOV
		
			nview.origin, nview.angles, wFOV = wCV(w, ply, pos * 1, ang * 1, nfov)
			
			if not force then
				nview.fov = wFOV
			
				if wFOV ~= nfov then
					vars["afov"] = wFOV
				end
			end
		end
	end

	return nview
end)

