hook.Add("RenderScene", vars["hookname"], function()
	if vars["fog"] then
		MATERIAL_FOG_LINEAR = 1
		MATERIAL_FOG_LINEAR_BELOW_FOG_Z	= 2
	else
		MATERIAL_FOG_LINEAR = 0
		MATERIAL_FOG_LINEAR_BELOW_FOG_Z	= 0
	end
	
	local dv = vars["devtexture"]
	local dvo = vars["devtexture_o"]
	local fb = vars["fullbright"]
	local nm = vars["nightmode"]
	local nmrs = vars["nightmode_rs"]
	
	if dv or (nm and not fb) or (not nm and not vars["nightmode_rs"]) then
		local int = math.Clamp(vars["nightmode_intensity"], 0, 1)
		local rsvec = Vector(1, 1, 1)
	
		for _, v in ipairs(meta_en.GetMaterials(game.GetWorld())) do
			local wm = Material(v)

			if dv then
				local n = string.lower(meta_im.GetName(wm))
			
				if vMat(n) then
					if dvo then
						meta_im.SetTexture(wm, "$basetexture", devtex_o)
					else
						meta_im.SetTexture(wm, "$basetexture", devtex)
					end
				end
			end
			
			if nm and not fb then
				meta_im.SetVector(wm, "$color", Vector(int, int, int))
			elseif not nmrs then
				meta_im.SetVector(wm, "$color", rsvec)
			end
		end
	end
	
	if nm and not fb then
		vars["nightmode_rs"] = false
	else
		vars["nightmode_rs"] = true
	end
	
	if dv then
		if dvo then
			render.MaterialOverride(devmat_o)
		else
			render.MaterialOverride(devmat)
		end
	else
		render.MaterialOverride(nil)
	end

	if fb then
		render.SuppressEngineLighting(false)
		render.ResetModelLighting(1, 1, 1)

		render.SetLightingMode(1)
	else
		render.SetLightingMode(0)
	end
end)

